import React from 'react';
import Title from '../Title/Title';
import Summer from '../Summer/Summer';
import Footer from '../Footer/Footer';
import { ProductConsumer } from '../../context';
import Card from '../Card/Card';
import Navbar from '../Navbar/Navbarpages';
import Breadcrumbs from '../Breadcrumbs/Breadcrumbs';


class Man extends React.Component {
	render() {
		return (
			<React.Fragment>
				<Navbar />
					<div className="container products-page">
						<Breadcrumbs />
						<div className='row'>
							<div className='col 12 product-page-title'>
							<Title name="Men's" title="products"></Title>
							<div className='col-12 col-md-10 col-lg-8 pages-text'>
							T-shirts are the ultimate wardrobe staple â€“ they're simple, they're versatile and they'll work for virtually any occasion. 
							Hit up our collection of men's T-shirts and vests for plain and printed designs to slot into your everyday rotation. 
							Check out web-site for oversized T-shirts and unique patterns, and make Topman your go-to for classic black and white t-shirts.
								</div> 
							</div>
						</div>
						<div className="row">
							<ProductConsumer>
								{value => {
									return value.products.map(product => {
										return <Card key={product.id} product ={product} />;
									});
								}}
							</ProductConsumer>
						</div>
					</div>

		        <Summer />
		        <Footer />
      		</React.Fragment>

		)
	}
}

export default Man;
